met Julianne Hough, Kenny Wormald en Dennis Quaid

Ariel Moore (Julianne Hough) is een meisje uit een klein dorpje op het platteland. Wanneer ze verliefd wordt op nieuwkomer Ren 
MacCormack (Kenny Wormald), ontdekt hij dat het in het dorp verboden is om harde muziek te draaien en om te dansen. Een 
tragisch ongeval was daar de oorzaak van. Ren komt al gauw oog in oog te staan met Ariels vader, dominee Shaw Moore 
(Dennis Quaid), in zijn pogingen om weer leven in de brouwerij te brengen.
